import logo from './logo.svg';
import './App.css';

function App() {
  eturn (
    <div className="App">
      <header>
        <nav>
          <ul>
            <li className='active'>Home</li>
            <li>About</li>
            <li>Contact</li>
          </ul>
        </nav>
      </header>
    </div>
  );
}

export default App;
